import React, { Component } from "react";
import Bey from "./Bey";

class BeyContainer extends Component {
  render() {
    const BeyCards = this.props.BeyArray.map(bey => (
      <li>
        <Bey key={bey.name} singleBey={bey} />
      </li>
    ));

    return <ul className="beyContainer">{BeyCards}</ul>;
  }
}

export default BeyContainer;
